import React from 'react'
import styled from "styled-components"
import axios from "axios"


const ButtonContainer = styled.div`
     display: flex;
     justify-content: space-between;
     width: 300px;
     margin-top: 50px;
`

export default class App extends React.Component {
   


    darMatch = () => {

        const urlBotoes = "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/:antonio-machado/choose-person"
        const bodyBotoes = {
            "id": "71gMbZs2txS9LDvGK5Ew",
            "choice": true
        }
      
        
        axios.get(urlBotoes)
        .then((res) => {
            console.log(res);
            /*this.setState({})*/        

        })
        .catch((err) => {
            console.log(err);
        });
    
    };

    render () {
      
    return (
      <div>`Nome: {this.state.nome}, Idade: {this.state.idade}, Bio: {this.state.bio}, Foto:  {this.state.foto}`
      <ButtonContainer>
      <button onClick={darMatch()}>Dar Match</button>
      <button>Ver outro Perfil</button>
      </ButtonContainer>
      </div>
    )

    }
}
